import React from 'react';
import { Link } from 'react-router-dom';

function ServiceCategory({ link, category }) {
    const myStyle = {
        color: 'red !important', // bu şekilde !important kullanılabilir, ancak pek tavsiye edilmez
        fontSize: '18px',
      };
    return (
        <>
            <li>
                <Link  style={myStyle} to={link}>{category}</Link>
            </li>
        </>
    );
}

export default ServiceCategory;
